function PrivateListPage() {
  const { serviceId } = useParams();

  const [providers, setProviders] = useState([]);
  const servicesRef = useRef(collection(db, `services/${serviceId}/providers`));

  useEffect(() => {
    const getPublicServices = async () => {
      try {
        const data = await getDocs(servicesRef.current);
        const filteredData = data.docs.map((doc) => ({
          ...doc.data(),
          id: doc.id,
        }));
        setProviders(filteredData);
        console.log(filteredData);
      } catch (err) {
        console.error(err);
      }
    };
    getPublicServices();
  }, [servicesRef]);

  return (
    <div>
      <NavLink to="/private-services">
        <BackButton />
      </NavLink>
      <div className="privateServiceDisplay">
        {providers.map((card) => {
          return (
            <PrivateServices
              key={card.id}
              nume={card.name}
              desc={card.description}
              link={card.website}
              img={card.image}
              location={card.location}
            />
          );
        })}
      </div>
    </div>
  );
}

export default PrivateListPage;
